import './App.scss';
import {Switch, Route} from "react-router-dom";

import HomePage from "./HomePage";


function App() {
  return (
      <Switch>
        <Route path="/about">
          <About />
        </Route>
        <Route path="/users">
          <Users />
        </Route>
        <Route path="/">
          <HomePage />
        </Route>
      </Switch>
  );
}

export default App;
